import React from "react";
import { Card } from "semantic-ui-react";

const styles = {
  card: {
    background: "#000",
    color: "#000"
  }
};
export default function CarData(props) {
  const { cars } = props;
  return cars.map((car, id) => {
    return (
      <Card key={id}>
        <Card.Content style={styles.card}>
          <Card.Header>{car.plate}</Card.Header>
          <Card.Description>
            <p>Address</p>
            <p>{car.address}</p>
          </Card.Description>
        </Card.Content>
      </Card>
    );
  });
}
